import React from "react";
import * as Custom from "./typeHeader";
import { Link } from "react-router-dom";
// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import { faSearch, faShoppingCart } from "@fortawesome/free-solid-svg-icons";
// import { faHeart } from "@fortawesome/free-regular-svg-icons";
// import { useDispatch, useSelector } from "react-redux";
// import * as action from "../../actions";
// import LoginForm from "../LoginForm";

export default () => {
  return (
    <Custom.Header>
      <div id="wrapper">
        <nav className="navbar navbar-default navbar-static-top m-b-0">
          <div className="navbar-header">
            <ul className="nav navbar-top-links navbar-right pull-right">
              <li>
                <form className="app-search hidden-sm hidden-xs m-r-10" role="search">
                  <input className="form-control" type="text" placeholder="Search..." />
                  <Link href="# "><i className="fa fa-search"></i></Link></form>
              </li>
              <li>
                <Link className="profile-pic" href="/">
                  {/* <img className="img-circle" src={`${http://localhost:8080/}/67396445_715918092179622_3974737570952118272_n.jpg`} alt="user-img" width="36" /> */}
                  <b className="hidden-xs">Linh Nguyễn</b>
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      </div>
      <div className="navbar-default sidebar" role="navigation">
        <div className="sidebar-nav slimscrollsidebar">
          <div className="top-left-part sidebar-head"><Link className="logo" href="/"><img src={require("../images/icons/logo-01.png")} alt="IMG-LOGO" /></Link></div>
          <ul className="nav" id="side-menu">
            <li><Link className="waves-effect" href="/"><i className="fa fa-table fa-fw" aria-hidden="true"></i>Product Table</Link></li>
            <li>
              <Link className="waves-effect" href="/admin/insert-product">
                <i className="fa fa-user fa-fw" aria-hidden="true"></i>Add product</Link>
            </li>
            <li>
              <Link className="waves-effect" href="/admin/category">
                <i className="fa fa-table fa-fw" aria-hidden="true"></i>Category Table</Link>
            </li>
          </ul>
        </div>
      </div>
    </Custom.Header>
  )
}
